import React, { useEffect, useState } from 'react'
import axios from 'axios'

const Chatpage = () => {

    const [first, setfirst] = useState()
    useEffect(() => {

        const fetchChats = async () => {

            const { data } = await axios.get('/api/chat')
            // console.log(data);
            setfirst(data)
        }
        fetchChats()

    }, [])

    console.log(first);
    return (
        <div>{first && first.map((chat) => {
            return (
                <div key={chat._id}>
                    {chat.chatName}
                </div>
            )
        })}</div>
    )
}

export default Chatpage
